import React, {useEffect} from 'react'
import { useNavigate } from "react-router-dom";
import "../styles/Menu.css";

function Menu({title}) {
  const navigate = useNavigate();

  function handleClick() {
    console.log(`/${title}`);
    navigate(`/${title}`);
  }

  useEffect(() => {
    handleClick();
  })


  return (
    <div className='menu'>
        <div className='menu-title' onClick={handleClick()}>
            {title}
        </div>
        
    </div>
  )
}

export default Menu
